contract Wolves is ERC721URIStorage,Ownable {

        using Counters for Counters.Counter;
        Counters.Counter public _tokenIds;

        using Strings for uint256;

        // Optional mapping for token URIs
        mapping (uint256 => string) private _tokenURIs;

        // map timestamp 
        mapping(uint256 => uint) public tokenIdTime;

        // Base URI
        string private _baseURIextended;

        uint256 tokenPrice = 50000000000000000;  // in wei
        uint256 maxToken = 10000; // Maximum token mint
        uint256 delayTime = 86400; // in timestamp

        constructor() ERC721("Howling Werewolves", "WOLVES") {}

        function _setTokenURI(uint256 tokenId, string memory _tokenURI) internal override virtual {
            require(_exists(tokenId), "ERC721Metadata: URI set of nonexistent token");
            _tokenURIs[tokenId] = _tokenURI;
        }


        function setBaseURI(string memory baseURI_) external onlyOwner() {
            _baseURIextended = baseURI_;
        }

        function _baseURI() internal view virtual override returns (string memory) {
            return _baseURIextended;
        }

        function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
            require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

            string memory _tokenURI = _tokenURIs[tokenId];
            string memory base = _baseURI();

            // If there is no base URI, return the token URI.
            if (bytes(base).length == 0) {
                return _tokenURI;
            }
            // If both are set, concatenate the baseURI and tokenURI (via abi.encodePacked).
            if (bytes(_tokenURI).length > 0) {
                return string(abi.encodePacked(base, _tokenURI));
            }
            // If there is a baseURI but no tokenURI, concatenate the tokenID to the baseURI.
            return string(abi.encodePacked(base, tokenId.toString()));
        }

        function setTokenPrice(uint256 _tokenPrice) public onlyOwner{
            tokenPrice = _tokenPrice;
        }

        function getTokenPrice() public view returns (uint256) {
            return tokenPrice;
        }

        function mint() public payable returns (uint256)
        {
            require(msg.value >= tokenPrice, string(abi.encodePacked(tokenPrice.toString(), " wei required to mint token")));
            _tokenIds.increment();
            uint256 newItemId = _tokenIds.current();
            require(newItemId <= maxToken, string(abi.encodePacked("Maximum ",maxToken.toString(), " token can be mint")));
            string memory tokenIdURI = newItemId.toString();
            _mint(msg.sender, newItemId);
            _setTokenURI(newItemId, tokenIdURI);
            tokenIdTime[newItemId] = block.timestamp + delayTime;
            address payable ownerAddress = payable(owner());
            ownerAddress.transfer(msg.value);
            return newItemId;
        }

        function transferFrom(address from, address to, uint256 tokenId) public override {
            require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");
            _transfer(from, to, tokenId);
        }

        function safeTransferFrom(address from, address to, uint256 tokenId) public override {
            safeTransferFrom(from, to, tokenId, "");
        }

        function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory _data) public override {
            require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");
            _safeTransfer(from, to, tokenId, _data);
        }

}

